import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from './components/Header';
import Footer from './components/Footer';
import HashGenerator from './components/HashGenerator';
import VisualHash from './components/VisualHash';
import PasswordCracker from './components/PasswordCracker';
import Home from './components/Home';
import FileDeduplicator from './components/FileDeduplicator';
import PasswordManager from './components/PasswordManager';
import HashCollisionDemo from './components/HashCollisionDemo';
import IdenticonGenerator from './components/IdenticonGenerator';
import LearnCryptography from './components/LearnCryptography';
import Sha256Animation from './components/Sha256Animation';
import NftGenerator from './components/NftGenerator';
import BioinformaticsHashing from './components/BioinformaticsHashing';
import SimilarImageFinder from './components/SimilarImageFinder';
import P2PMessaging from './components/P2PMessaging';
import './styles/App.css';

function App() {
  document.documentElement.lang = 'fa';
  document.documentElement.dir = 'rtl';
  
  return (
    <Router>
      <div className="App">
        <Header />
        <main className="container">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/hash-generator" element={<HashGenerator />} />
            <Route path="/visual-hash" element={<VisualHash />} />
            <Route path="/password-cracker" element={<PasswordCracker />} />
            <Route path="/file-deduplicator" element={<FileDeduplicator />} />
            <Route path="/password-manager" element={<PasswordManager />} />
            <Route path="/hash-collision" element={<HashCollisionDemo />} />
            <Route path="/identicon-generator" element={<IdenticonGenerator />} />
            <Route path="/learn-cryptography" element={<LearnCryptography />} />
            <Route path="/sha256-animation" element={<Sha256Animation />} />
            <Route path="/nft-generator" element={<NftGenerator />} />
            <Route path="/bioinformatics" element={<BioinformaticsHashing />} />
            <Route path="/similar-image-finder" element={<SimilarImageFinder />} />
            <Route path="/p2p-messaging" element={<P2PMessaging />} />
          </Routes>
        </main>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
